import React from 'react'
import {Field} from 'redux-form'
import {File} from '../../common/FormsControls/File'
import { required, MinLength, MaxLength } from '../../../utils/Validators/validators'





const MaxLengthCreator20 = MaxLength(20)
const MinLengthCreator5 = MinLength(5)
const UploadFile=(props)=>{
  return(
    <div>
    <Field type="file" validate={[required, MinLengthCreator5, MaxLengthCreator20]} component={File} name={props.name} className="form-control" />
    </div>
  )
}

export default UploadFile
